import React from 'react';
import classes from './MyButton.module.css'

const MyBotton = () => {
    return (
        <button className={classes.MyBtn} >
          <div className={classes.Img}></div>
          <p className={classes.Text}>Добавить отзыв</p>
        </button>
    );
};

export default MyBotton;
